import React from 'react';
import { Link } from 'react-router-dom';
import '../components/NavBar.css'; // Import your CSS file
import Logo from '../assets/images/elementary-red-logo.png';
import userStore from '../utils/userStore';

const NavBar = () => {
    const { user } = userStore()
    return (
        <div>

            <header>
                <nav>
                    <div id="NavBar">
                        <ul>
                            <li className="nav-left-container">
                                <img src={Logo} alt="Logo" className="Logo" />
                                <li><Link to="/home" className="home">home</Link></li>
                                <li><Link to="/customize" className="CustomizePage">generate</Link></li>
                                <li><Link to="/help" className="home">support</Link></li>
                                <li><Link to="/home" className="home">about</Link></li>
                            </li>
                            <p>{user}</p>
                            {user ?
                                <li className="nav-right-container right-links">
                                    <li><Link to="#">{user}</Link></li>
                                    <li><Link to="/login" className="signin-button">Logout</Link></li>
                                </li>
                                :
                                <li className="nav-right-container right-links">
                                    <li><Link to="/signup">sign up</Link></li>
                                    <li><Link to="/login" className="signin-button">sign in</Link></li>
                                </li>}
                        </ul>

                    </div>
                </nav>
            </header>




        </div>

    );
};

export default NavBar;
